-compile({nowarn_unused_function,merge_msg_m_train_upgrade_toc/3}).
merge_msg_m_train_upgrade_toc(#m_train_upgrade_toc{train
						       = PFtrain},
			      #m_train_upgrade_toc{train = NFtrain},
			      TrUserData) ->
