    #m_train_figure_tos{type = NFtype}.

-compile({nowarn_unused_function,merge_msg_m_train_figure_toc/3}).
merge_msg_m_train_figure_toc(#m_train_figure_toc{},
			     #m_train_figure_toc{type = NFtype}, _) ->
    #m_train_figure_toc{type = NFtype}.

-compile({nowarn_unused_function,merge_msg_m_train_attr_tos/3}).
merge_msg_m_train_attr_tos(#m_train_attr_tos{},
			   #m_train_attr_tos{type = NFtype,
					     item_id = NFitem_id},
			   _) ->
