-compile({nowarn_unused_function,merge_msg_m_train_attr_toc/3}).
merge_msg_m_train_attr_toc(#m_train_attr_toc{},
			   #m_train_attr_toc{type = NFtype, item_id = NFitem_id,
					     level = NFlevel},
			   _) ->
    #m_train_attr_toc{type = NFtype, item_id = NFitem_id,
		      level = NFlevel}.

-compile({nowarn_unused_function,merge_msg_p_train/3}).
merge_msg_p_train(#p_train{train = PFtrain},
		  #p_train{type = NFtype, level = NFlevel, exp = NFexp,
			   train = NFtrain},
		  TrUserData) ->
    #p_train{type = NFtype, level = NFlevel, exp = NFexp,
	     train =
		 if PFtrain /= undefined, NFtrain /= undefined ->
			'tr_merge_p_train.train'(PFtrain, NFtrain, TrUserData);
		    PFtrain == undefined -> NFtrain;
		    NFtrain == undefined -> PFtrain
		 end}.


verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      m_train_info_tos ->
	  v_msg_m_train_info_tos(Msg, [MsgName], TrUserData);
      m_train_info_toc ->
	  v_msg_m_train_info_toc(Msg, [MsgName], TrUserData);
      m_train_upgrade_tos ->
	  v_msg_m_train_upgrade_tos(Msg, [MsgName], TrUserData);
      m_train_upgrade_toc ->
	  v_msg_m_train_upgrade_toc(Msg, [MsgName], TrUserData);
      m_train_figure_tos ->
	  v_msg_m_train_figure_tos(Msg, [MsgName], TrUserData);
      m_train_figure_toc ->
	  v_msg_m_train_figure_toc(Msg, [MsgName], TrUserData);
      m_train_attr_tos ->
	  v_msg_m_train_attr_tos(Msg, [MsgName], TrUserData);
      m_train_attr_toc ->
	  v_msg_m_train_attr_toc(Msg, [MsgName], TrUserData);
      p_train -> v_msg_p_train(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_m_train_info_tos/3}).
-dialyzer({nowarn_function,v_msg_m_train_info_tos/3}).
v_msg_m_train_info_tos(#m_train_info_tos{type = F1},
		       Path, TrUserData) ->
    v_type_int32(F1, [type | Path], TrUserData), ok;
v_msg_m_train_info_tos(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, m_train_info_tos}, X,
		  Path).

-compile({nowarn_unused_function,v_msg_m_train_info_toc/3}).
-dialyzer({nowarn_function,v_msg_m_train_info_toc/3}).
v_msg_m_train_info_toc(#m_train_info_toc{train = F1},
		       Path, TrUserData) ->
    v_msg_p_train(F1, [train | Path], TrUserData), ok;
v_msg_m_train_info_toc(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, m_train_info_toc}, X,
		  Path).

-compile({nowarn_unused_function,v_msg_m_train_upgrade_tos/3}).
-dialyzer({nowarn_function,v_msg_m_train_upgrade_tos/3}).
v_msg_m_train_upgrade_tos(#m_train_upgrade_tos{type =
						   F1,
					       item_id = F2},
			  Path, TrUserData) ->
    v_type_int32(F1, [type | Path], TrUserData),
